import React from 'react';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; {currentYear} John Doe. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
